import Musica from '../../images/Musica.png';


class CardAdmin extends React.Component{
    render(){
        return(
            <main>        
                <CardForm2 ID='card_1 card_inicio' Image={Actividades} ID__1="card_1 card_inicio" CardName='Actividades' />
                <CardForm2 ID='card_2 card_inicio' Image={Musica} ID__1="card_2 card_inicio" CardName='Musica' />
                            </main>    
        )
    }
}
export default CardAdmin;
